Blockly.Msg.TOOLBOX_WALK="Walk";Blockly.Msg.TOUCH_ISPRESSED_TOOLTIP="Is the touch sensor pressed?";Blockly.Msg.TOUCH_TOOLTIP="Is the touch sensor pressed?";Blockly.Msg.TOUR1_DESCRIPTION00="next";Blockly.Msg.TOUR1_DESCRIPTION01="Welcome,<br>click on  \u00bbnext\u00ab and start a tour through the Open Roberta Lab.<br>I'll show you how you can program your robot with NEPO.<br>You can end this tour all the time with a click on \u00bbX\u00ab in the right upper corner.";
Blockly.Msg.TOUR1_DESCRIPTION02="The menu ;-)";Blockly.Msg.TOUR1_DESCRIPTION03="Here you can find everything you need to program the robot!<br><span class='typcn typcn-document-text'></span> Save and load programs<br><span class='typcn typcn-ev3'></span> Connect your robot to the Open Roberta Lab or switch to another system<br><span class='typcn typcn-lightbulb'></span> Help for all kinds of problems<br><span class='typcn typcn-user'></span>Everything about user accounts, e.g. login or logoff<br><span class='typcn typcn-th-large-outline'></span> Look at the gallery and try great programs from other users!<br><span class='typcn typcn-world'></span> Click here to switch to another language";
Blockly.Msg.TOUR1_DESCRIPTION04="Click here and switch to the robot configuration";Blockly.Msg.TOUR1_DESCRIPTION05="You can adapt the robot configuration later,<br>if you've constructed another robot.<br>If you don't have a robot and want to test your program in the simulation <br>this configuration is applied.";Blockly.Msg.TOUR1_DESCRIPTION06="Click here and switch back to the programming area!";Blockly.Msg.TOUR1_DESCRIPTION07="The toolbox.<br>Here you can find all programming blocks.";
Blockly.Msg.TOUR1_DESCRIPTION07a="Once you are an experienced user you can switch here to the expert mode of the toolbox.<br>You will then find more blocks to program your robot.<br><span class='typcn typcn-media-stop-outline'></span> beginner mode<br><span class='typcn typcn-star-outline'></span> expert mode";Blockly.Msg.TOUR1_DESCRIPTION08="Each program starts with the \u00bbprogram start\u00ab block.<br>Further programming blocks, which the robot should execute, should be attached to this block.<br>Just drag'n drop the desired block right under the start block.";
Blockly.Msg.TOUR1_DESCRIPTION09="Here you find some shortcuts!<br>From left to right:<br><span class='typcn typcn-media-play'></span> Click here to execute the program on the real robot<br><span class='typcn typcn-cloud-storage'></span> Save your program, but before that you need to sign in<br><span class='typcn typcn-zoom'></span> Click here and zoom in on the blocks, if you want to<br><span class='typcn typcn-archive'></span> The trashcan! Just move blocks into the trashcan and they will be deleted.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Attention: You cannot recover blocks once they are deleted!<br>";
